[{"location":"lib/internals/#Internals-Documentation","page":"Internals Documentation","title":"Internals Documentation","text":"","category":"section"},{"location":"lib/internals/#Index","page":"Internals Documentation","title":"Index","text":"","category":"section"},{"location":"lib/internals/","page":"Internals Documentation","title":"Internals Documentation","text":"Pages = [\"internals.md\"]","category":"page"},{"location":"lib/internals/#Internal-Methods","page":"Internals Documentation","title":"Internal Methods","text":"","category":"section"},{"location":"lib/internals/","page":"Internals Documentation","title":"Internals Documentation","text":"Pages = [\n    \"../methods/internals/parameters.md\",\n    \"../methods/internals/latent.md\",\n    \"../methods/internals/response.md\",\n    \"../methods/internals/probability.md\",\n    \"../methods/internals/information.md\",\n    \"../methods/internals/likelihood.md\",\n]\nDepth = 1","category":"page"},{"location":"methods/internals/information/#Information-(Item-Information-Function)-(Internals)","page":"Information (Item Information Function) (Internals)","title":"Information (Item Information Function) (Internals)","text":"","category":"section"},{"location":"methods/internals/information/","page":"Information (Item Information Function) (Internals)","title":"Information (Item Information Function) (Internals)","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/internals/information/#Information-wrt-\\theta","page":"Information (Item Information Function) (Internals)","title":"Information wrt theta","text":"","category":"section"},{"location":"methods/internals/information/","page":"Information (Item Information Function) (Internals)","title":"Information (Item Information Function) (Internals)","text":"    _information_latent(latent::Latent1D, parameters::Parameters1PL)\n    _information_latent(latent::Latent1D, parameters::Parameters2PL)\n    _information_latent(latent::Latent1D, parameters::Parameters3PL)","category":"page"},{"location":"methods/internals/information/#Psychometrics._information_latent-Tuple{Psychometrics.Latent1D,Psychometrics.Parameters1PL}","page":"Information (Item Information Function) (Internals)","title":"Psychometrics._information_latent","text":"informationlatent(latent::Latent1D, parameters::Parameters1PL)\n\nDescription\n\nIt computes the information (second derivative of the likelihood) with respect to the 1-dimensional latent variable under the 1PL model. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \nparameters::Parameters1PL : Required. A 1-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/information/#Psychometrics._information_latent-Tuple{Psychometrics.Latent1D,Psychometrics.Parameters2PL}","page":"Information (Item Information Function) (Internals)","title":"Psychometrics._information_latent","text":"informationlatent(latent::Latent1D, parameters::Parameters2PL)\n\nDescription\n\nIt computes the information (-second derivative of the likelihood) with respect to the 1-dimensional latent variable under the 2PL model. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \nparameters::Parameters2PL : Required. A 2-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/information/#Psychometrics._information_latent-Tuple{Psychometrics.Latent1D,Psychometrics.Parameters3PL}","page":"Information (Item Information Function) (Internals)","title":"Psychometrics._information_latent","text":"informationlatent(latent::Latent1D, parameters::Parameters3PL)\n\nDescription\n\nIt computes the information (-second derivative of the likelihood) with respect to the 1-dimensional latent variable under the 3PL model. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \nparameters::Parameters3PL : Required. A 3-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/information/#Information-wrt-Item-Parameters","page":"Information (Item Information Function) (Internals)","title":"Information wrt Item Parameters","text":"","category":"section"},{"location":"methods/internals/information/","page":"Information (Item Information Function) (Internals)","title":"Information (Item Information Function) (Internals)","text":"_expected_information_item(parameters::Parameters1PL, latent::Latent1D)\n_expected_information_item(parameters::Parameters2PL, latent::Latent1D)\n_expected_information_item(parameters::Parameters3PL, latent::Latent1D)\n_observed_information_item(\n    parameters::Parameters3PL,\n    latent::Latent1D,\n    response_val::Float64,\n)","category":"page"},{"location":"methods/internals/information/#Psychometrics._expected_information_item-Tuple{Psychometrics.Parameters1PL,Psychometrics.Latent1D}","page":"Information (Item Information Function) (Internals)","title":"Psychometrics._expected_information_item","text":"expectedinformation_item(parameters::Parameters1PL, latent::Latent1D)\n\nDescription\n\nIt computes the expected information (-second derivative of the likelihood) with respect to the difficulty parameter of the 1PL model. It follows the parametrization a(θ - b).\n\nArguments\n\nparameters::Parameters1PL : Required. A 1-parameter logistic parameters object. \nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/information/#Psychometrics._expected_information_item-Tuple{Psychometrics.Parameters2PL,Psychometrics.Latent1D}","page":"Information (Item Information Function) (Internals)","title":"Psychometrics._expected_information_item","text":"expectedinformation_item(parameters::Parameters2PL, latent::Latent1D)\n\nDescription\n\nIt computes the expected information (-second derivative of the likelihood) with respect to the 2 parameters of the 2PL model. It follows the parametrization a(θ - b).\n\nArguments\n\nparameters::Parameters1PL : Required. A 2-parameter logistic parameters object. \nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \n\nOutput\n\nA 2 times 2 matrix of the expected informations. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/information/#Psychometrics._expected_information_item-Tuple{Psychometrics.Parameters3PL,Psychometrics.Latent1D}","page":"Information (Item Information Function) (Internals)","title":"Psychometrics._expected_information_item","text":"expectedinformation_item(parameters::Parameters3PL, latent::Latent1D)\n\nDescription\n\nIt computes the expected information (-second derivative of the likelihood) with respect to the 3 parameters of the 3PL model.  It follows the parametrization a(θ - b).\n\nArguments\n\nparameters::Parameters1PL : Required. A 3-parameter logistic parameters object. \nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \n\nOutput\n\nA 3 times 3 matrix of the expected informations. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/information/#Psychometrics._observed_information_item-Tuple{Psychometrics.Parameters3PL,Psychometrics.Latent1D,Float64}","page":"Information (Item Information Function) (Internals)","title":"Psychometrics._observed_information_item","text":"observedinformationitem(     parameters::Parameters3PL,     latent::Latent1D,     responseval::Float64, )\n\nDescription\n\nIt computes the observed information (-second derivative of the likelihood) with respect to the 3 parameters of the 3PL model.  It follows the parametrization a(θ - b).\n\nArguments\n\nparameters::Parameters3PL : Required. A 3-parameter logistic parameters object. \nresponse_val::Float64 : Required. A scalar response. \nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \n\nOutput\n\nA 3 times 3 matrix of the observed informations. \n\n\n\n\n\n","category":"method"},{"location":"lib/public/#Public-Documentation","page":"Public Documentation","title":"Public Documentation","text":"","category":"section"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"Documentation for Psychometrics.jl's public interface.","category":"page"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"See the Internals Documentation Section of the manual for internal package docs covering unexported functions.","category":"page"},{"location":"lib/public/#Index","page":"Public Documentation","title":"Index","text":"","category":"section"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"Pages = [\"public.md\"]","category":"page"},{"location":"lib/public/#Abstracts","page":"Public Documentation","title":"Abstracts","text":"","category":"section"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"AbstractItem\nAbstractExaminee\nAbstractParameters\nAbstractParametersBinary\nAbstractLatent\nAbstractResponse","category":"page"},{"location":"lib/public/#Structs-and-Abstracts","page":"Public Documentation","title":"Structs and Abstracts","text":"","category":"section"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"Item\nExaminee\nParameters1PL\nParameters2PL\nParameters3PL\nLatent1D\nLatentND\nResponse","category":"page"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"Each of the mentioned structs has a random default factory, callable by using the name of the struct followed by ().","category":"page"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"Example: Parameters2PL() generates a set of 2PL item parameters from the product distribution (independent bivariate).","category":"page"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"Distributions.Product([\n   Distributions.LogNormal(0, 0.25),\n   Distributions.Normal(0, 1)\n])","category":"page"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"The immutable structs Item and Examinee need the identification fields id and idx to be randomly generated. ","category":"page"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"Example: `Item(1, \\\"item1\\\")generates an operational item with an emptycontent` description, and a default 1PL item parameter._","category":"page"},{"location":"lib/public/#Exported-Methods","page":"Public Documentation","title":"Exported Methods","text":"","category":"section"},{"location":"lib/public/","page":"Public Documentation","title":"Public Documentation","text":"Pages = [\n    \"../methods/exported/item.md\",\n    \"../methods/exported/examinee.md\",\n    \"../methods/exported/response.md\",\n    \"../methods/exported/probability.md\",\n    \"../methods/exported/information.md\",\n    \"../methods/exported/likelihood.md\",\n]\nDepth = 1","category":"page"},{"location":"methods/internals/response/#Responses-(Internals)","page":"Responses (Internals)","title":"Responses (Internals)","text":"","category":"section"},{"location":"methods/internals/response/","page":"Responses (Internals)","title":"Responses (Internals)","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/internals/response/","page":"Responses (Internals)","title":"Responses (Internals)","text":"_generate_response(latent::Latent1D, parameters::AbstractParametersBinary)","category":"page"},{"location":"methods/internals/response/#Psychometrics._generate_response-Tuple{Psychometrics.Latent1D,Psychometrics.AbstractParametersBinary}","page":"Responses (Internals)","title":"Psychometrics._generate_response","text":"_generate_response(latent::Latent1D, parameters::AbstractParametersBinary)\n\nRandomly generate a response for a 1-dimensional latent variable and custom item parameters.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Responses","page":"Responses","title":"Responses","text":"","category":"section"},{"location":"methods/exported/response/","page":"Responses","title":"Responses","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/exported/response/","page":"Responses","title":"Responses","text":"get_examinees_by_item_id(item_id::String, responses::Vector{<:AbstractResponse},  examinees::Vector{<:AbstractExaminee})\nget_items_by_examinee_id(examinee_id::String, responses::Vector{<:AbstractItem})\nadd_response!(response::AbstractResponse, responses::Vector{<:AbstractResponse})\nget_responses_by_examinee_id(examinee_id::String, responses::Vector{<:AbstractResponse})\nget_responses_by_item_id(item_id::String, responses::Vector{<:AbstractResponse})\nget_responses_by_item_idx(item_idx::Int64, responses::Vector{<:AbstractResponse}; sorted = true)\nanswer(examinee::AbstractExaminee, item::AbstractItem)\nanswer(examinee::AbstractExaminee, items::Vector{<:AbstractItem})\nanswer(examinee_id::String, item_id::String, examinees::Vector{<:AbstractExaminee}, items::Vector{<:AbstractItem})\nanswer(examinees:Vector{<:AbstractExaminee}, items::Vector{<:AbstractItem})\nget_design_matrix(responses::Vector{Response}, I::Int64, N::Int64)\nget_response_matrix(responses::Vector{Response}, I::Int64, N::Int64)\nget_responses(response_matrix::Matrix{Float64}, design_matrix::Matrix{Float64}, items::Vector{<:AbstractItem}, examinees::Vector{<:AbstractExaminee})\nget_items_idx_answered_by_examinee(\n    examinee::AbstractExaminee,\n    responses::Vector{<:AbstractResponse},\n)\nget_examinees_idx_who_answered_item(\n    item::AbstractItem,\n    responses::Vector{<:AbstractResponse},\n)","category":"page"},{"location":"methods/exported/response/#Psychometrics.get_examinees_by_item_id-Tuple{String,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractExaminee}","page":"Responses","title":"Psychometrics.get_examinees_by_item_id","text":"get_examinees_by_item_id(item_id::String, responses::Vector{<:AbstractResponse}, examinees::Vector{<:AbstractExaminee})\n\nIt returns the examinees who answered to the item with id item_id.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.add_response!-Tuple{Psychometrics.AbstractResponse,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse}","page":"Responses","title":"Psychometrics.add_response!","text":"add_response!(response::AbstractResponse, responses::Vector{<:AbstractResponse})\n\nPush the response in the response vector responses.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.get_responses_by_examinee_id-Tuple{String,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse}","page":"Responses","title":"Psychometrics.get_responses_by_examinee_id","text":"get_responses_by_examinee_id(examinee_id::String, responses::Vector{<:AbstractResponse})\n\nIt returns the vector of responses given by examinee with id = id.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.get_responses_by_item_id-Tuple{String,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse}","page":"Responses","title":"Psychometrics.get_responses_by_item_id","text":"get_responses_by_item_id(item_id::String, responses::Vector{<:AbstractResponse})\n\nIt returns the vector of responses to item with id equal to item_id.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.get_responses_by_item_idx-Tuple{Int64,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse}","page":"Responses","title":"Psychometrics.get_responses_by_item_idx","text":"get_responses_by_item_idx(item_idx::Int64, responses::Vector{<:AbstractResponse}; sorted = true)\n\nIt returns the vector of responses to item with idx equal to item_idx. The vector of responses is sorted by examinee_idx if sorted = true.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.answer-Tuple{Psychometrics.AbstractExaminee,Psychometrics.AbstractItem}","page":"Responses","title":"Psychometrics.answer","text":"answer(examinee::AbstractExaminee, item::AbstractItem)\n\nRandomly generate a response by examinee to a dichotomous (binary) item.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.answer-Tuple{Psychometrics.AbstractExaminee,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractItem}","page":"Responses","title":"Psychometrics.answer","text":"answer(examinee::AbstractExaminee, items::Vector{<:AbstractItem})\n\nRandomly generate a response by examinee to dichotomous (binary) items.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.answer-Tuple{String,String,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractExaminee,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractItem}","page":"Responses","title":"Psychometrics.answer","text":"answer(examinee_id::String, item_id::String, examinees::Vector{<:AbstractExaminee}, items::Vector{<:AbstractItem})\n\nRandomly generate a response by Examinee with index examinee_id to a dichotomous (binary) item with index item_id.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.get_design_matrix-Tuple{Array{Psychometrics.Response,1},Int64,Int64}","page":"Responses","title":"Psychometrics.get_design_matrix","text":"get_design_matrix(responses::Vector{Response}, I::Int64, N::Int64)\n\nReturns the I times N design matrix.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.get_response_matrix-Tuple{Array{Psychometrics.Response,1},Int64,Int64}","page":"Responses","title":"Psychometrics.get_response_matrix","text":"get_response_matrix(responses::Vector{Response}, I::Int64, N::Int64)\n\nTransform vector of Responses in a I x N response matrix. A non given answer has value 0.0.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.get_responses-Tuple{Array{Float64,2},Array{Float64,2},Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractItem,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractExaminee}","page":"Responses","title":"Psychometrics.get_responses","text":"get_responses(response_matrix::Matrix{Float64}, design_matrix::Matrix{Float64}, items::Vector{<:AbstractItem}, examinees::Vector{<:AbstractExaminee})\n\nTransforms a I x N response matrix in a vector of Responses given a valid design_matrix, a vector of Items and a vector of Examinees.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.get_items_idx_answered_by_examinee-Tuple{Psychometrics.AbstractExaminee,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse}","page":"Responses","title":"Psychometrics.get_items_idx_answered_by_examinee","text":"getitemsidxansweredby_examinee(     examinee::AbstractExaminee,     responses::Vector{<:AbstractResponse}, )\n\nDescription\n\nReturns the idx of the items answered by examinee.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/response/#Psychometrics.get_examinees_idx_who_answered_item-Tuple{Psychometrics.AbstractItem,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse}","page":"Responses","title":"Psychometrics.get_examinees_idx_who_answered_item","text":"getexamineesidxwhoanswered_item(     item::AbstractItem,     responses::Vector{<:AbstractResponse}, )\n\nDescription\n\nReturns the idx of the examinees who answered to item.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/item/#Items","page":"Items","title":"Items","text":"","category":"section"},{"location":"methods/exported/item/","page":"Items","title":"Items","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/exported/item/","page":"Items","title":"Items","text":"get_parameters(item::AbstractItem)\nget_item_by_id(item_id::String, items::Vector{<:AbstractItem})\nget_parameters(items::Vector{<:AbstractItem})\nempty_chain!(item::AbstractItem)\nchain_append!(item::AbstractItem; sampling = false)","category":"page"},{"location":"methods/exported/item/#Psychometrics.get_parameters-Tuple{Psychometrics.AbstractItem}","page":"Items","title":"Psychometrics.get_parameters","text":"get_parameters(item::AbstractItem)\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/item/#Psychometrics.get_item_by_id-Tuple{String,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractItem}","page":"Items","title":"Psychometrics.get_item_by_id","text":"get_item_by_id(item_id::String, items::Vector{<:AbstractItem})\n\nIt returns the item with index item_id from a vector of <:AbstractItem.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/item/#Psychometrics.get_parameters-Tuple{Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractItem}","page":"Items","title":"Psychometrics.get_parameters","text":"get_parameters(items::Vector{<:AbstractItem})\n\nReturns a matrix with item parameters displayed by row.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/item/#Psychometrics.empty_chain!-Tuple{Psychometrics.AbstractItem}","page":"Items","title":"Psychometrics.empty_chain!","text":"empty_chain!(item::AbstractItem)\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/item/#Psychometrics.chain_append!-Tuple{Psychometrics.AbstractItem}","page":"Items","title":"Psychometrics.chain_append!","text":"chain_append!(item::AbstractItem; sampling = false)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/latent/#Latent-Variable-(Internals)","page":"Latent Variable (Internals)","title":"Latent Variable (Internals)","text":"","category":"section"},{"location":"methods/internals/latent/","page":"Latent Variable (Internals)","title":"Latent Variable (Internals)","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/internals/latent/","page":"Latent Variable (Internals)","title":"Latent Variable (Internals)","text":"    _empty_chain!(latent::Latent1D)\n    _set_val!(latent::Latent1D, val::Float64)\n    _set_val_from_chain!(latent::Latent1D)\n    _update_estimate!(latent::Latent1D; sampling = true)\n    _chain_append!(latent::Latent1D; sampling = false)","category":"page"},{"location":"methods/internals/latent/#Psychometrics._empty_chain!-Tuple{Psychometrics.Latent1D}","page":"Latent Variable (Internals)","title":"Psychometrics._empty_chain!","text":"_empty_chain!(latent::Latent1D)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/latent/#Psychometrics._set_val!-Tuple{Psychometrics.Latent1D,Float64}","page":"Latent Variable (Internals)","title":"Psychometrics._set_val!","text":"_set_val!(latent::Latent1D, val::Float64)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/latent/#Psychometrics._set_val_from_chain!-Tuple{Psychometrics.Latent1D}","page":"Latent Variable (Internals)","title":"Psychometrics._set_val_from_chain!","text":"_set_val_from_chain!(latent::Latent1D)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/latent/#Psychometrics._update_estimate!-Tuple{Psychometrics.Latent1D}","page":"Latent Variable (Internals)","title":"Psychometrics._update_estimate!","text":"_update_estimate!(latent::Latent1D; sampling = true)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/latent/#Psychometrics._chain_append!-Tuple{Psychometrics.Latent1D}","page":"Latent Variable (Internals)","title":"Psychometrics._chain_append!","text":"_chain_append!(latent::Latent1D; sampling = false)\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/probability/#Probability-(Item-Characteristic-Function)","page":"Probability (Item Characteristic Function)","title":"Probability (Item Characteristic Function)","text":"","category":"section"},{"location":"methods/exported/probability/","page":"Probability (Item Characteristic Function)","title":"Probability (Item Characteristic Function)","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/exported/probability/#Values-in-Matrix-form","page":"Probability (Item Characteristic Function)","title":"Values in Matrix form","text":"","category":"section"},{"location":"methods/exported/probability/","page":"Probability (Item Characteristic Function)","title":"Probability (Item Characteristic Function)","text":"    probability(parameters_matrix::Matrix{Float64}, latent_matrix::Matrix{Float64})\n    probability_3PL(parameters_matrix::Matrix{Float64}, latent_matrix::Matrix{Float64})","category":"page"},{"location":"methods/exported/probability/#Psychometrics.probability-Tuple{Array{Float64,2},Array{Float64,2}}","page":"Probability (Item Characteristic Function)","title":"Psychometrics.probability","text":"probability(parameters_matrix::Matrix{Float64}, latent_matrix::Matrix{Float64})\n\nDescription\n\nIt computes the probability (ICF) of a correct response for item parameters and latents values provided in matrix form. Not suitable for 3PL models, for such a kind of model use probability_3PL(). It follows the parametrization a theta - b.\n\nArguments\n\nparameters_matrix::Matrix{Float64} : Required. A n_latents x N matrix with latents values. \nlatent_matrix::Matrix{Float64} : Required. A I x (n_latents + 1) matrix with item parameters. intercept (b) must be in first column, latents coefficients (aj) in next columns (2, ..., nlatents + 1). \n\nOutput\n\nA I x N Float64 matrix. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/probability/#Psychometrics.probability_3PL-Tuple{Array{Float64,2},Array{Float64,2}}","page":"Probability (Item Characteristic Function)","title":"Psychometrics.probability_3PL","text":"probability_3PL(parameters_matrix::Matrix{Float64}, latent_matrix::Matrix{Float64})\n\nDescription\n\nOnly for models which has guessing parameter (c) in last row of parameters_matrix. It computes the probability (ICF) of a correct response for item parameters and latents values provided in matrix form. It follows the parametrization a theta - b.\n\nArguments\n\nparameters_matrix::Matrix{Float64} : Required. A n_latents x N matrix with latents values. \nlatent_matrix::Matrix{Float64} : Required. A I x (n_latents + 1) matrix with item parameters. intercept (b) must be in first column, latents coefficients (aj) in next columns (2, ..., nlatents + 1). \n\nOutput\n\nA I x N Float64 matrix. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/probability/#Using-Structs","page":"Probability (Item Characteristic Function)","title":"Using Structs","text":"","category":"section"},{"location":"methods/exported/probability/","page":"Probability (Item Characteristic Function)","title":"Probability (Item Characteristic Function)","text":"    probability(examinee::AbstractExaminee, item::AbstractItem)\n    probability(examinees::Vector{<:AbstractExaminee}, items::Vector{<:AbstractItem})\n    probability(items::Vector{<:AbstractItem}, examinees::Vector{<:AbstractExaminee})","category":"page"},{"location":"methods/exported/probability/#Psychometrics.probability-Tuple{Psychometrics.AbstractExaminee,Psychometrics.AbstractItem}","page":"Probability (Item Characteristic Function)","title":"Psychometrics.probability","text":"probability(examinee::AbstractExaminee, item::AbstractItem)\n\nDescription\n\nIt computes the probability (ICF) that an examinee answers correctly at item.\n\nArguments\n\nexaminee::AbstractExaminee : Required. An Examinee. \nitem::AbstractItem : Required. An Item. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/probability/#Psychometrics.probability-Tuple{Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractExaminee,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractItem}","page":"Probability (Item Characteristic Function)","title":"Psychometrics.probability","text":"probability(examinees::Vector{<:AbstractExaminee}, items::Vector{<:AbstractItem})\n\nDescription\n\nIt computes the probability (ICF) that a vector of examinees answers correctly at a vector of items.\n\nArguments\n\nexaminees::Vector{<:AbstractExaminee} : Required. A vector of Examinees. \nitems::Vector{<:AbstractItem} : Required. A vector of Items. \n\nOutput\n\nA matrixexa. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/probability/#Psychometrics.probability-Tuple{Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractItem,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractExaminee}","page":"Probability (Item Characteristic Function)","title":"Psychometrics.probability","text":"probability(items::Vector{<:AbstractItem}, examinees::Vector{<:AbstractExaminee})\n\nDescription\n\nIt computes the probability (ICF) that a vector of examinees answers correctly at a vector of items.\n\nArguments\n\nexaminees::Vector{<:AbstractExaminee} : Required. A vector of Examinees. \nitems::Vector{<:AbstractItem} : Required. A vector of Items. \n\nOutput\n\nA matrix. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/examinee/#Examinees","page":"Examinees","title":"Examinees","text":"","category":"section"},{"location":"methods/exported/examinee/","page":"Examinees","title":"Examinees","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/exported/examinee/","page":"Examinees","title":"Examinees","text":"get_latents(examinees::Vector{<:AbstractExaminee})\nempty_chain!(examinee::AbstractExaminee)","category":"page"},{"location":"methods/exported/examinee/#Psychometrics.get_latents-Tuple{Array{var\"#s1\",1} where var\"#s1\"<:Psychometrics.AbstractExaminee}","page":"Examinees","title":"Psychometrics.get_latents","text":"get_latents(examinees::Vector{<:AbstractExaminee})\n\nReturns a matrix with latent values displayed by row.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/examinee/#Psychometrics.empty_chain!-Tuple{Psychometrics.AbstractExaminee}","page":"Examinees","title":"Psychometrics.empty_chain!","text":"empty_chain!(examinee::AbstractExaminee)\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/bayesian/#Bayesian-IRT","page":"Bayesian IRT","title":"Bayesian IRT","text":"","category":"section"},{"location":"methods/exported/bayesian/","page":"Bayesian IRT","title":"Bayesian IRT","text":"Modules = [Psychometrics]\nPages   = [\"bayesian.jl\"]","category":"page"},{"location":"methods/exported/bayesian/#Psychometrics.posterior-Tuple{Psychometrics.AbstractExaminee,Array{var\"#s14\",1} where var\"#s14\"<:Psychometrics.AbstractItem,Array{var\"#s13\",1} where var\"#s13\"<:Psychometrics.AbstractResponse,Array{Psychometrics.PolyaGammaSample,1}}","page":"Bayesian IRT","title":"Psychometrics.posterior","text":"posterior(\n    examinee::AbstractExaminee,\n    items::Vector{<:AbstractItem}, #only items answered by examinee sorted by i.idx\n    responses::Vector{<:AbstractResponse}, #only responses of examinee sorted by i.idx\n    W::Vector{PolyaGammaSample};\n    already_sorted = false,\n)\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/bayesian/#Psychometrics.posterior-Tuple{Psychometrics.AbstractExaminee,Psychometrics.AbstractItem,Psychometrics.Response,Psychometrics.PolyaGammaSample}","page":"Bayesian IRT","title":"Psychometrics.posterior","text":"posterior(\n    examinee::AbstractExaminee,\n    item::AbstractItem,\n    response::Response,\n    w::PolyaGammaSample,\n    )\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/bayesian/#Psychometrics.posterior-Tuple{Psychometrics.AbstractItem,Array{var\"#s52\",1} where var\"#s52\"<:Psychometrics.AbstractExaminee,Array{var\"#s53\",1} where var\"#s53\"<:Psychometrics.AbstractResponse,Array{Psychometrics.PolyaGammaSample,1}}","page":"Bayesian IRT","title":"Psychometrics.posterior","text":"posterior(\n    item::AbstractItem,\n    examinees::Vector{<:AbstractExaminee}, \n    responses::Vector{<:AbstractResponse},\n    W::Vector{PolyaGammaSample};\n    already_sorted = false,\n)\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/bayesian/#Psychometrics.update_posterior!-Tuple{Psychometrics.AbstractExaminee,Array{var\"#s14\",1} where var\"#s14\"<:Psychometrics.AbstractItem,Array{var\"#s13\",1} where var\"#s13\"<:Psychometrics.AbstractResponse,Array{Psychometrics.PolyaGammaSample,1}}","page":"Bayesian IRT","title":"Psychometrics.update_posterior!","text":"update_posterior!(\n    examinee::AbstractExaminee,\n    items::Vector{<:AbstractItem},\n    responses::Vector{<:AbstractResponse},\n    W::Vector{PolyaGammaSample};\n    already_sorted = false,\n)\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/bayesian/#Psychometrics.update_posterior!-Tuple{Psychometrics.AbstractItem,Array{var\"#s14\",1} where var\"#s14\"<:Psychometrics.AbstractExaminee,Array{var\"#s13\",1} where var\"#s13\"<:Psychometrics.AbstractResponse,Array{Psychometrics.PolyaGammaSample,1}}","page":"Bayesian IRT","title":"Psychometrics.update_posterior!","text":"update_posterior!(\n    item::AbstractItem,\n    examinees::Vector{<:AbstractExaminee},\n    responses::Vector{<:AbstractResponse},\n    W::Vector{PolyaGammaSample};\n    already_sorted = false,\n)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/bayesian/#Bayesian-IRT","page":"Bayesian IRT","title":"Bayesian IRT","text":"","category":"section"},{"location":"methods/internals/bayesian/","page":"Bayesian IRT","title":"Bayesian IRT","text":"Modules = [Psychometrics]\nPages   = [\"bayesian.jl\"]","category":"page"},{"location":"methods/internals/parameters/#Item-Parameters-(Internals)","page":"Item Parameters (Internals)","title":"Item Parameters (Internals)","text":"","category":"section"},{"location":"methods/internals/parameters/","page":"Item Parameters (Internals)","title":"Item Parameters (Internals)","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/internals/parameters/","page":"Item Parameters (Internals)","title":"Item Parameters (Internals)","text":"    _add_prior!(parameters::AbstractParameters, prior::Distributions.Distribution) \n    _add_prior!(parameters::AbstractParameters, priors::Vector{Distributions.UnivariateDistribution})\n    _add_posterior!(parameters::AbstractParameters, posterior::Distributions.Distribution) \n    _add_posterior!(parameters::AbstractParameters, priors::Vector{Distributions.UnivariateDistribution}) \n    _empty_chain!(parameters::Parameters1PL)\n    _empty_chain!(parameters::Parameters2PL)\n    _empty_chain!(parameters::Parameters3PL)\n    _chain_append!(parameters::Union{Parameters2PL,Parameters3PL}; sampling = false)\n    _set_val!(parameters::Parameters2PL, vals::Vector{Float64})\n    _set_val_from_chain!(parameters::Parameters2PL)\n    _update_estimate!(parameters::Parameters2PL; sampling = true)","category":"page"},{"location":"methods/internals/parameters/#Psychometrics._add_posterior!-Tuple{Psychometrics.AbstractParameters,Distributions.Distribution}","page":"Item Parameters (Internals)","title":"Psychometrics._add_posterior!","text":"_add_posterior!(parameters::AbstractParameters, posterior::Distributions.Distribution)\n\nDescription\n\nIt assigns the <n>-variate posterior distribution to a AbstractParameters instance with <n> parameters.\n\nArguments\n\nparameters::AbstractParameters : Required. Any type of parameters object. \nposterior::Distributions.Distribution : Required. A <n>-variate probability distribution where <n> > 1 and is the numebr of item parameters in parameters. \n\nExamples\n\nparameters2PL = Parameters2PL()\nbivariate_normal = Distributions.MultivariateNormal([0,0], LinearAlgebra.I(2))\n_add_posterior!(parameters2PL, bivariate_normal)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/parameters/#Psychometrics._add_posterior!-Tuple{Psychometrics.AbstractParameters,Array{Distributions.Distribution{Distributions.Univariate,S} where S<:Distributions.ValueSupport,1}}","page":"Item Parameters (Internals)","title":"Psychometrics._add_posterior!","text":"_add_posterior!(parameters::AbstractParameters, priors::Vector{Distributions.UnivariateDistribution})\n\nDescription\n\nIt transforms the vector posteriors of univariate distributions to their products and assign it to AbstractParameters instance.\n\nArguments\n\nparameters::AbstractParameters : Required. Any type of parameters object. \nposteriors::Vector{Distributions.UnivariateDistribution} : Required. A vector of probability distributions. The size of the vector must be the same as the number of parameters. \n\nExamples\n\nparameters2PL = Parameters2PL()\na_dist = Distributions.Normal(0,1)\nb_dist = Distributions.Normal(0,1)\n_add_posterior!(parameters2PL, [a_dist, b_dist])\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/parameters/#Psychometrics._empty_chain!-Tuple{Psychometrics.Parameters1PL}","page":"Item Parameters (Internals)","title":"Psychometrics._empty_chain!","text":"_empty_chain!(parameters::Parameters1PL)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/parameters/#Psychometrics._empty_chain!-Tuple{Psychometrics.Parameters2PL}","page":"Item Parameters (Internals)","title":"Psychometrics._empty_chain!","text":"_empty_chain!(parameters::Parameters2PL)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/parameters/#Psychometrics._empty_chain!-Tuple{Psychometrics.Parameters3PL}","page":"Item Parameters (Internals)","title":"Psychometrics._empty_chain!","text":"_empty_chain!(parameters::Parameters3PL)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/parameters/#Psychometrics._chain_append!-Tuple{Union{Psychometrics.Parameters2PL, Psychometrics.Parameters3PL}}","page":"Item Parameters (Internals)","title":"Psychometrics._chain_append!","text":"_chain_append!(parameters::Union{Parameters2PL,Parameters3PL}; sampling = false)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/parameters/#Psychometrics._set_val!-Tuple{Psychometrics.Parameters2PL,Array{Float64,1}}","page":"Item Parameters (Internals)","title":"Psychometrics._set_val!","text":"_set_val!(parameters::Parameters2PL, vals::Vector{Float64})\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/parameters/#Psychometrics._set_val_from_chain!-Tuple{Psychometrics.Parameters2PL}","page":"Item Parameters (Internals)","title":"Psychometrics._set_val_from_chain!","text":"_set_val_from_chain!(parameters::Parameters2PL)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/parameters/#Psychometrics._update_estimate!-Tuple{Psychometrics.Parameters2PL}","page":"Item Parameters (Internals)","title":"Psychometrics._update_estimate!","text":"_update_estimate!(parameters::Parameters2PL; sampling = true)\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/distributions/#Distributions","page":"Distributions","title":"Distributions","text":"","category":"section"},{"location":"methods/internals/distributions/","page":"Distributions","title":"Distributions","text":"Modules = [Psychometrics]\nPages   = [\"dist.jl\"]","category":"page"},{"location":"methods/internals/likelihood/#Likelihood-(Internals)","page":"Likelihood (Internals)","title":"Likelihood (Internals)","text":"","category":"section"},{"location":"methods/internals/likelihood/","page":"Likelihood (Internals)","title":"Likelihood (Internals)","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/internals/likelihood/#Using-Structs","page":"Likelihood (Internals)","title":"Using Structs","text":"","category":"section"},{"location":"methods/internals/likelihood/","page":"Likelihood (Internals)","title":"Likelihood (Internals)","text":"_likelihood(\n    response_val::Float64,\n    latent_val::Float64,\n    parameters::AbstractParametersBinary,\n)\n_log_likelihood(\n    response_val::Float64,\n    latent::Latent1D,\n    parameters::AbstractParametersBinary,\n)\n_log_likelihood(\n    response_val::Float64,\n    latent::Latent1D,\n    parameters::AbstractParametersBinary,\n    g_item::Vector{Float64},\n    g_latent::Vector{Float64},\n)","category":"page"},{"location":"methods/internals/likelihood/#Psychometrics._likelihood-Tuple{Float64,Float64,Psychometrics.AbstractParametersBinary}","page":"Likelihood (Internals)","title":"Psychometrics._likelihood","text":"likelihood(     responseval::Float64,     latent_val::Float64,     parameters::AbstractParametersBinary, )\n\n#Description\n\nIt computes the likelihood for a latent value and item parameters parameters with answer response_val.\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/likelihood/#Psychometrics._log_likelihood-Tuple{Float64,Psychometrics.Latent1D,Psychometrics.AbstractParametersBinary}","page":"Likelihood (Internals)","title":"Psychometrics._log_likelihood","text":"loglikelihood(     response_val::Float64,     latent::Latent1D,     parameters::AbstractParametersBinary, )\n\nDescription\n\nIt computes the log likelihood for a 1-dimensional latent variable and item parameters parameters with answer response_val.\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/likelihood/#Psychometrics._log_likelihood-Tuple{Float64,Psychometrics.Latent1D,Psychometrics.AbstractParametersBinary,Array{Float64,1},Array{Float64,1}}","page":"Likelihood (Internals)","title":"Psychometrics._log_likelihood","text":"loglikelihood(     responseval::Float64,     latent::Latent1D,     parameters::AbstractParametersBinary,     gitem::Vector{Float64},     g_latent::Vector{Float64}, )\n\nDescription\n\nIt computes the log likelihood for a 1-dimensional latent variable and item parameters parameters with answer response_val.  It updates also the gradient vectors.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/likelihood/#Likelihood","page":"Likelihood","title":"Likelihood","text":"","category":"section"},{"location":"methods/exported/likelihood/","page":"Likelihood","title":"Likelihood","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/exported/likelihood/","page":"Likelihood","title":"Likelihood","text":"log_likelihood(\n    response_val::Float64,\n    latent_val::Float64,\n    parameters::AbstractParametersBinary,\n)\nlog_likelihood(\n    response::AbstractResponse,\n    examinee::AbstractExaminee,\n    item::AbstractItem,\n)\nlog_likelihood(\n    response::AbstractResponse,\n    examinee::AbstractExaminee,\n    item::AbstractItem,\n    g_item::Vector{Float64},\n    g_latent::Vector{Float64},\n)\nlog_likelihood(\n    responses::Vector{<:AbstractResponse},\n    examinees::Vector{<:AbstractExaminee},\n    items::Vector{<:AbstractItem},\n)\nlog_likelihood(\n    responses::Vector{<:AbstractResponse},\n    examinees::Vector{<:AbstractExaminee},\n    items::Vector{<:AbstractItem},\n    g_item::Vector{Float64},\n    g_latent::Vector{Float64},\n)\nlikelihood(\n    response::AbstractResponse,\n    examinee::AbstractExaminee,\n    item::AbstractItem,\n)\nlikelihood(\n    responses::Vector{<:AbstractResponse},\n    examinees::Vector{<:AbstractExaminee},\n    items::Vector{<:AbstractItem},\n)    ","category":"page"},{"location":"methods/exported/likelihood/#Psychometrics.log_likelihood-Tuple{Float64,Float64,Psychometrics.AbstractParametersBinary}","page":"Likelihood","title":"Psychometrics.log_likelihood","text":"loglikelihood(     responseval::Float64,     latent_val::Float64,     parameters::AbstractParametersBinary, )\n\nDescription\n\nIt computes the log likelihood for a latent value and item parameters parameters with answer response_val.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/likelihood/#Psychometrics.log_likelihood-Tuple{Psychometrics.AbstractResponse,Psychometrics.AbstractExaminee,Psychometrics.AbstractItem}","page":"Likelihood","title":"Psychometrics.log_likelihood","text":"log_likelihood(     response::AbstractResponse,     examinee::AbstractExaminee,     item::AbstractItem, )\n\nDescription\n\nIt computes the log likelihood for a response. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/likelihood/#Psychometrics.log_likelihood-Tuple{Psychometrics.AbstractResponse,Psychometrics.AbstractExaminee,Psychometrics.AbstractItem,Array{Float64,1},Array{Float64,1}}","page":"Likelihood","title":"Psychometrics.log_likelihood","text":"loglikelihood(     response::AbstractResponse,     examinee::AbstractExaminee,     item::AbstractItem,     gitem::Vector{Float64},     g_latent::Vector{Float64}, )\n\nDescription\n\nIt computes the log likelihood for a response response.  It updates also the gradient vectors.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/likelihood/#Psychometrics.log_likelihood-Tuple{Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractExaminee,Array{var\"#s1\",1} where var\"#s1\"<:Psychometrics.AbstractItem}","page":"Likelihood","title":"Psychometrics.log_likelihood","text":"log_likelihood(     responses::Vector{<:AbstractResponse},     examinees::Vector{<:AbstractExaminee},     items::Vector{<:AbstractItem}, )\n\nDescription\n\nIt computes the log likelihood for a vector of responses responses. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/likelihood/#Psychometrics.log_likelihood-Tuple{Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractExaminee,Array{var\"#s1\",1} where var\"#s1\"<:Psychometrics.AbstractItem,Array{Float64,1},Array{Float64,1}}","page":"Likelihood","title":"Psychometrics.log_likelihood","text":"loglikelihood(     responses::Vector{<:AbstractResponse},     examinees::Vector{<:AbstractExaminee},     items::Vector{<:AbstractItem},     gitem::Vector{Float64},     g_latent::Vector{Float64}, )\n\nDescription\n\nIt computes the log likelihood for a vector of responses responses.  It updates also the gradient vectors.\n\n\n\n\n\n","category":"method"},{"location":"methods/exported/likelihood/#Psychometrics.likelihood-Tuple{Psychometrics.AbstractResponse,Psychometrics.AbstractExaminee,Psychometrics.AbstractItem}","page":"Likelihood","title":"Psychometrics.likelihood","text":"likelihood(     response::AbstractResponse,     examinee::AbstractExaminee,     item::AbstractItem, )\n\nDescription\n\nIt computes the log likelihood for a response. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/likelihood/#Psychometrics.likelihood-Tuple{Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractExaminee,Array{var\"#s1\",1} where var\"#s1\"<:Psychometrics.AbstractItem}","page":"Likelihood","title":"Psychometrics.likelihood","text":"likelihood(     responses::Vector{<:AbstractResponse},     examinees::Vector{<:AbstractExaminee},     items::Vector{<:AbstractItem}, )\n\nDescription\n\nIt computes the log likelihood for a vector of responses responses. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/probability/#Probability-(Item-Characteristic-Function)-(Internals)","page":"Probability (Item Characteristic Function) (Internals)","title":"Probability (Item Characteristic Function) (Internals)","text":"","category":"section"},{"location":"methods/internals/probability/","page":"Probability (Item Characteristic Function) (Internals)","title":"Probability (Item Characteristic Function) (Internals)","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/internals/probability/#PL","page":"Probability (Item Characteristic Function) (Internals)","title":"1PL","text":"","category":"section"},{"location":"methods/internals/probability/","page":"Probability (Item Characteristic Function) (Internals)","title":"Probability (Item Characteristic Function) (Internals)","text":"    __probability(latent_val::Float64, parameters::Parameters1PL)\n    _probability(latent::Latent1D, parameters::Parameters1PL)\n    _probability(latent::Latent1D, parameters::Parameters1PL, g_item::Vector{Float64}, g_latent::Vector{Float64})","category":"page"},{"location":"methods/internals/probability/#Psychometrics.__probability-Tuple{Float64,Psychometrics.Parameters1PL}","page":"Probability (Item Characteristic Function) (Internals)","title":"Psychometrics.__probability","text":"__probability(latent_val::Float64, parameters::Parameters1PL)\n\nDescription\n\nIt computes the probability (ICF) of a correct response for item parameters under the 1PL model at latent_val point. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent_val::Float64 : Required. The point in the latent space in which compute the probability. \nparameters::Parameters1PL : Required. A 1-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/probability/#Psychometrics._probability-Tuple{Psychometrics.Latent1D,Psychometrics.Parameters1PL}","page":"Probability (Item Characteristic Function) (Internals)","title":"Psychometrics._probability","text":"_probability(latent::Latent1D, parameters::Parameters1PL)\n\nDescription\n\nIt computes the probability (ICF) of a correct response for item parameters under the 1PL model at Latent1D point. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \nparameters::Parameters1PL : Required. A 1-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/probability/#Psychometrics._probability-Tuple{Psychometrics.Latent1D,Psychometrics.Parameters1PL,Array{Float64,1},Array{Float64,1}}","page":"Probability (Item Characteristic Function) (Internals)","title":"Psychometrics._probability","text":"_probability(latent::Latent1D, parameters::Parameters1PL, g_item::Vector{Float64}, g_latent::Vector{Float64})\n\nDescription\n\nIt computes the probability (ICF) of a correct response for item parameters under the 1PL model at Latent1D point. It updates the gradient vectors if they are not empty. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \nparameters::Parameters1PL : Required. A 1-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/probability/#PL-2","page":"Probability (Item Characteristic Function) (Internals)","title":"2PL","text":"","category":"section"},{"location":"methods/internals/probability/","page":"Probability (Item Characteristic Function) (Internals)","title":"Probability (Item Characteristic Function) (Internals)","text":"    __probability(latent_val::Float64, parameters::Parameters2PL)\n    _probability(latent::Latent1D, parameters::Parameters2PL)\n    _probability(latent::Latent1D, parameters::Parameters2PL, g_item::Vector{Float64}, g_latent::Vector{Float64})","category":"page"},{"location":"methods/internals/probability/#Psychometrics.__probability-Tuple{Float64,Psychometrics.Parameters2PL}","page":"Probability (Item Characteristic Function) (Internals)","title":"Psychometrics.__probability","text":"__probability(latent_val::Float64, parameters::Parameters2PL)\n\nDescription\n\nIt computes the probability (ICF) of a correct response for item parameters under the 2PL model at latent_val point. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent_val::Float64 : Required. The point in the latent space in which compute the probability. \nparameters::Parameters2PL : Required. A 2-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/probability/#Psychometrics._probability-Tuple{Psychometrics.Latent1D,Psychometrics.Parameters2PL}","page":"Probability (Item Characteristic Function) (Internals)","title":"Psychometrics._probability","text":"_probability(latent::Latent1D, parameters::Parameters2PL)\n\nDescription\n\nIt computes the probability (ICF) of a correct response for item parameters under the 2PL model at Latent1D point. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \nparameters::Parameters2PL : Required. A 2-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\n\n\n\n\n","category":"method"},{"location":"methods/internals/probability/#Psychometrics._probability-Tuple{Psychometrics.Latent1D,Psychometrics.Parameters2PL,Array{Float64,1},Array{Float64,1}}","page":"Probability (Item Characteristic Function) (Internals)","title":"Psychometrics._probability","text":"_probability(latent::Latent1D, parameters::Parameters2PL, g_item::Vector{Float64}, g_latent::Vector{Float64})\n\nDescription\n\nIt computes the probability (ICF) of a correct response for item parameters under the 2PL model at Latent1D point. It updates the gradient vectors if they are not empty. It follows the parametrization a(θ - b).\n\nArguments\n\nlatent::Latent1D : Required. A 1-dimensional Latent1D latent variable. \nparameters::Parameters2PL : Required. A 2-parameter logistic parameters object. \n\nOutput\n\nA Float64 scalar. \n\nExample\n\nProbability of a correct response is computed for each examinee and each item.\n\nexaminees = [Examinee() for n = 1 : 10]; #default examinee factory\nitems = [Item() for i = 1 : 30]; #default item factory\nprobability(examinees, items) #compute the probability\n\n\n\n\n\n","category":"method"},{"location":"methods/internals/probability/#PL-3","page":"Probability (Item Characteristic Function) (Internals)","title":"3PL","text":"","category":"section"},{"location":"methods/internals/probability/","page":"Probability (Item Characteristic Function) (Internals)","title":"Probability (Item Characteristic Function) (Internals)","text":"__probability(latent_val::Float64, parameters::Parameters3PL)\n_probability(latent::Latent1D, parameters::Parameters3PL)\n_probability(latent::Latent1D, parameters::Parameters3PL,  g_item::Vector{Float64}, g_latent::Vector{Float64})\n__probability(latent_vals::Vector{Float64}, parameters::Parameters3PL)\n_probability(latent::Latent1D, parameters::Parameters3PL,  g_item::Vector{Float64}, g_latent::Vector{Float64})","category":"page"},{"location":"methods/internals/probability/","page":"Probability (Item Characteristic Function) (Internals)","title":"Probability (Item Characteristic Function) (Internals)","text":"```","category":"page"},{"location":"methods/exported/information/#Information-(Item-Information-Function)","page":"Information (Item Information Function)","title":"Information (Item Information Function)","text":"","category":"section"},{"location":"methods/exported/information/","page":"Information (Item Information Function)","title":"Information (Item Information Function)","text":"    CurrentModule = Psychometrics","category":"page"},{"location":"methods/exported/information/#Information-wrt-\\theta","page":"Information (Item Information Function)","title":"Information wrt theta","text":"","category":"section"},{"location":"methods/exported/information/#Values-in-Matrix-form","page":"Information (Item Information Function)","title":"Values in Matrix form","text":"","category":"section"},{"location":"methods/exported/information/","page":"Information (Item Information Function)","title":"Information (Item Information Function)","text":"information_latent(latents_matrix::Matrix{Float64}, parameters_matrix::Matrix{Float64})\ninformation_latent_3PL(\n    latents_matrix::Matrix{Float64},\n    parameters_matrix::Matrix{Float64},\n)","category":"page"},{"location":"methods/exported/information/#Psychometrics.information_latent-Tuple{Array{Float64,2},Array{Float64,2}}","page":"Information (Item Information Function)","title":"Psychometrics.information_latent","text":"information_latent(latents_matrix::Matrix{Float64}, parameters_matrix::Matrix{Float64})\n\nDescription\n\nIt computes the information function (IIF) for item parameters at latents values provided in matrix form. Not suitable for 3PL models, for such a kind of model use information_latent_3PL(). It follows the parametrization a theta - b. See the docs of information_latent(examinee::AbstractExaminee, item::AbstractItem) for details.\n\nArguments\n\nlatents_matrix::Matrix{Float64} : Required. A n_latents times N matrix with latents values. \nparameters_matrix::Matrix{Float64} : Required. A (n_latents + 1) times I matrix with item parameters. intercept (b) must be in first row, latents coefficients (a_j) in next rows (2 ldots n_latents + 1). \n\nOutput\n\nA I x N Float64 matrix. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/information/#Psychometrics.information_latent_3PL-Tuple{Array{Float64,2},Array{Float64,2}}","page":"Information (Item Information Function)","title":"Psychometrics.information_latent_3PL","text":"informationlatent3PL(     latentsmatrix::Matrix{Float64},     parametersmatrix::Matrix{Float64}, )\n\nDescription\n\nOnly for models which has guessing parameter (c) in last row of parameters_matrix. It computes the information function (IIF) for item parameters at latents values provided in matrix form. It follows the parametrization a theta - b.\n\nArguments\n\nlatents_matrix::Matrix{Float64} : Required. A n_latents x N matrix with latents values. \nparameters_matrix::Matrix{Float64} : Required. A (n_latents + 1) x I matrix with item parameters. intercept (b) must be in first row, latents coefficients (aj) in next rows (2, ..., nlatents + 1). \n\nOutput\n\nA I x N Float64 matrix. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/information/#Using-Structs","page":"Information (Item Information Function)","title":"Using Structs","text":"","category":"section"},{"location":"methods/exported/information/","page":"Information (Item Information Function)","title":"Information (Item Information Function)","text":"information_latent(examinee::AbstractExaminee, item::AbstractItem)\ninformation_latent(examinee::AbstractExaminee, items::Vector{<:AbstractItem})\ninformation_latent(\n    examinees::Vector{<:AbstractExaminee},\n    items::Vector{<:AbstractItem},\n)","category":"page"},{"location":"methods/exported/information/#Psychometrics.information_latent-Tuple{Psychometrics.AbstractExaminee,Psychometrics.AbstractItem}","page":"Information (Item Information Function)","title":"Psychometrics.information_latent","text":"information_latent(examinee::AbstractExaminee, item::AbstractItem)\n\nDescription\n\nAn abstraction of _information_latent(latent::AbstractLatent, parameters::AbstractParametersBinary) on an examinee and an item. It follows the parametrization a(θ - b).\n\nArguments\n\nexaminee::AbstractExaminee : Required. \nitem::AbstractItem : Required. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/information/#Psychometrics.information_latent-Tuple{Psychometrics.AbstractExaminee,Array{var\"#s1\",1} where var\"#s1\"<:Psychometrics.AbstractItem}","page":"Information (Item Information Function)","title":"Psychometrics.information_latent","text":"information_latent(examinee::AbstractExaminee, items::Vector{<:AbstractItem})\n\nDescription\n\nAn abstraction of _information_latent(latent::AbstractLatent, parameters::AbstractParametersBinary) on an examinee and items. It follows the parametrization a(θ - b).\n\nArguments\n\nexaminee::AbstractExaminee : Required. \nitems::Vector{<:AbstractItem} : Required. \n\nExample\n\nCompute the Fisher information for the latents of the examinees (second derivatives of the likelihood with respect to the latent theta) and each item.\n\nE_theta_n  I(theta_n  b_i) \n\nexaminees = [Examinee() for n = 1 : 10]; #default examinee factory\nitems = [Item() for i = 1 : 30]; #default item factory\nprobability(examinees, items) #compute the probability\ninformation_latent(examinees, items) #compute the information wrt θ   \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/information/#Psychometrics.information_latent-Tuple{Array{var\"#s1\",1} where var\"#s1\"<:Psychometrics.AbstractExaminee,Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractItem}","page":"Information (Item Information Function)","title":"Psychometrics.information_latent","text":"information_latent(     examinees::Vector{<:AbstractExaminee},     items::Vector{<:AbstractItem}, )\n\nDescription\n\nAn abstraction of _information_latent(latent::AbstractLatent, parameters::AbstractParametersBinary) on examinees and items. It follows the parametrization a(θ - b).\n\nArguments\n\nexaminees::Vector{<:AbstractExaminee} : Required. \nitems::Vector{<:AbstractItem} : Required. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/information/#Information-wrt-Item-Parameters","page":"Information (Item Information Function)","title":"Information wrt Item Parameters","text":"","category":"section"},{"location":"methods/exported/information/","page":"Information (Item Information Function)","title":"Information (Item Information Function)","text":"expected_information_item(\n    items::Vector{<:AbstractItem},\n    examinees::Vector{<:AbstractExaminee},\n)\nobserved_information_item(\n    items::Vector{<:AbstractItem},\n    examinees::Vector{<:AbstractExaminee},\n    responses::Vector{<:AbstractResponse},\n)","category":"page"},{"location":"methods/exported/information/#Psychometrics.expected_information_item-Tuple{Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractItem,Array{var\"#s1\",1} where var\"#s1\"<:Psychometrics.AbstractExaminee}","page":"Information (Item Information Function)","title":"Psychometrics.expected_information_item","text":"expectedinformationitem(     items::Vector{<:AbstractItem},     examinees::Vector{<:AbstractExaminee}, )\n\nDescription\n\nAbstraction of expectedinformation_item(latent, parameters) on Vector{<:AbstractExaminee} and items::Vector{<:AbstractItem}. It follows the parametrization a(θ - b).\n\nArguments\n\nitems::Vector{<:AbstractItem} : Required. Size I x 1.\nexaminees::Vector{<:AbstractExaminee} : Required. Size N x 1.\n\nOutput\n\nA N x I matrix of the expected informations matrices. \n\n\n\n\n\n","category":"method"},{"location":"methods/exported/information/#Psychometrics.observed_information_item-Tuple{Array{var\"#s2\",1} where var\"#s2\"<:Psychometrics.AbstractItem,Array{var\"#s1\",1} where var\"#s1\"<:Psychometrics.AbstractExaminee,Array{var\"#s3\",1} where var\"#s3\"<:Psychometrics.AbstractResponse}","page":"Information (Item Information Function)","title":"Psychometrics.observed_information_item","text":"observedinformationitem(     items::Vector{<:AbstractItem},     examinees::Vector{<:AbstractExaminee},     responses::Vector{<:AbstractResponse}, )\n\nDescription\n\nAbstraction to response, item and examinee of _observed_information_item(response_val::Float64, latent::Latent1D, parameters::Parameters3PL). It follows the parametrization a(θ - b).\n\n\n\n\n\n","category":"method"},{"location":"","page":"Psychometrics.jl","title":"Psychometrics.jl","text":"CurrentModule = Psychometrics\nDocTestSetup = quote\n    using Psychometrics\nend","category":"page"},{"location":"#Psychometrics.jl","page":"Psychometrics.jl","title":"Psychometrics.jl","text":"","category":"section"},{"location":"","page":"Psychometrics.jl","title":"Psychometrics.jl","text":"A Julia package for psychometric data analysis.","category":"page"},{"location":"#Package-Features","page":"Psychometrics.jl","title":"Package Features","text":"","category":"section"},{"location":"","page":"Psychometrics.jl","title":"Psychometrics.jl","text":"This package is a playground I built for working on my research projects. It provides objects (Julia structs) and dedicated methods (functions) to deal with psychometric data under the item response theory (IRT) statistical paradigm.","category":"page"},{"location":"","page":"Psychometrics.jl","title":"Psychometrics.jl","text":"The documentation is still in progress. Nevertheless, some functions have detailed descriptions that can be found in the documentation pages or using the Julia help ?.","category":"page"},{"location":"","page":"Psychometrics.jl","title":"Psychometrics.jl","text":"(In progress) The Tutorial provides a tutorial explaining how to get started using Psychometrics.","category":"page"},{"location":"#Index","page":"Psychometrics.jl","title":"Index","text":"","category":"section"},{"location":"","page":"Psychometrics.jl","title":"Psychometrics.jl","text":"Pages = [\"lib/public.md\", \"lib/internals.md\"]","category":"page"},{"location":"methods/exported/distributions/#Distributions","page":"Distributions","title":"Distributions","text":"","category":"section"},{"location":"methods/exported/distributions/","page":"Distributions","title":"Distributions","text":"Modules = [Psychometrics]\nPages   = [\"dist.jl\"]","category":"page"}]
